$(document).ready(function(){$("a.show-more").on("click",function(){return $($(this).data("target")).dropdown("toggle"),!1});$(".filter-product .dropdown-menu").on("show.bs.dropdown",function(){$(this).off("click")});$(".filter-product .dropdown-menu a.dropdown-item").on("click",function(){window.location=$(this).attr("href")});$.widget("custom.catcomplete",$.ui.autocomplete,{_create:function(){this._super();this.widget().menu("option","items","> :not(.autocomplete-category)")},_renderMenu:function(n,t){var r=this,i="";$.each(t,function(t,r){r.itemType!==i&&(n.append("<li class='dropdown-header autocomplete-category'>"+r.itemType+"<\/li>"),i=r.itemType);n.append("<li class='dropdown-item'><a href='"+r.itemLink+"'>"+r.itemName+"<\/a><\/li>")})}});$("[data-autocomplete-source]").each(function(){var n=$(this);n.catcomplete({delay:500,minLength:2,source:n.attr("data-autocomplete-source")})})});